import React from 'react';

function Login(){
    return(
        <div className='w-screen h-screen bg-sky-200 bg-opacity-75 text-center'>
            <h1 className='text-4xl text-orange-400'>Login</h1>
            <form className='flex flex-col gap-5 bg-white rounded-md w-[50vw] text-center'>
                <div>
                <label htmlFor="mail">email or username:</label>
                <input type='email' className='' required name='mail'/>
                </div>
            </form>
        </div>
    );
}

export default Login;
